export default {
	items: Get_Units.data,
	selectedItem : {},
	getItems: async () => {
		//use async-await or promises
		if(!Get_Units.data) {
			await Get_Units.run();
		}
		this.items = Get_Units.data;
		return this.items;
	},
	options : (tenant) => {
		let options = [];
		if(this.items) {
			let temp = this.items;
			if(tenant) {
				temp = this.items.filter(function(item){
					return item._pp_tenant_value === tenant;
				});
			}
			temp.forEach(function(item){
				options.push({
					label : item.pp_name,
					value : item.pp_unitid
				});
			});
		}
		return options;
	}
}
